import React from 'react';
import PhotoList from './PhotoList';

function Projects({ currentChoice }){
    const { name, description } = currentChoice;
    return(
        <sectiom>
            <h1>{name}</h1>
            <p>{description}</p>
            <PhotoList />
        </sectiom>
    )
}
export default Projects;
